In questo incontra, ciascuna strighe ha stringato la mano a ciascuno dei dieci stregoni. Poiché ci sono dieci stregoni, e ciascuna strighe ha stringato la mano a ciascuno di loro, il total di strette di mano che hanno avuto luogo è:

\[
10 \text{ stregoni} \times 1 \text{ strighe per stone} = 10 \text{ strette di mano}
\]

Quindi, la risposta è:

\boxed{10}
